import React from 'react'
import "./homepage.css"
import axios from 'axios'

const Homepage = ({setLoginUser, user}) => {

    const gitrepo = async () => {
        const result = await axios.post(`https://api.github.com/users/${user.gituser}/repos`)
        .then(res => {
            console.log(res)
        })
    }

    return(
        <div className='homepage'>
            {console.log(user)}
            <h1>Hi {user.name}</h1>
            <div className='button' onClick={() => setLoginUser({})}>Logout</div>    
        </div>
    )
}

export default Homepage
